import React from 'react';
import {Route, Switch} from "react-router-dom";
import Homepage from './Homepage';
import LogIn from './LogIn'
import RouteHelper from './RouteHelper';

export default({childProps}) =>
<Switch>
    <RouteHelper path="/" exact component={Homepage} props={childProps}/>
    <RouteHelper path="/login" exact component={LogIn} props={childProps}/>
    <RouterHelper path="/Survey" exact component={Survey}/>
</Switch>
